import React, {Component} from 'react'

class FooterComponent extends Component {
    render() {
        return (
            <footer className="footer">
                <span className="text-muted">All Rights Reserved 2018 @TODO-APP</span>
            </footer>
        )
    }
}

export default FooterComponent
